eld editor element\",\"license\":\"U\"},\"subContentId\":\"8df48796-c8a8-46b9-ad9f-0e1685fa931c\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. What were the fossilisation conditions?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"234bc76c-4f9d-4b53-b310-86ef0bc4b92c\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>5. Based on the document and answers you've collected above, can you now explain the presence of fossils in Hjoula, the village of Chadi's grandparents? </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"356cf14d-1f00-4893-87a6-0d02bc1895c8\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"75384663-539b-44b7-8572-151ff0ba1f68\",\"metadata\":{\"title\":\"Fossils in Hjoula\",\"license\":\"U\",\"contentType\":\"Standard page\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Fossils in Hjoula\"}},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>After completely reading the document and answering the questions, check your answers below.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a7fe6f2c-9cd7-4745-8425-43e554dbb940\"},{\"params\":{\"text\":\"<p>1. The animals lived in the Thethys sea until 100 million years ago.</p>\\n\\n<p>2. The plankton uses all the oxygen in the seawater and releases poison.</p>\\n\\n<p>3. They sunk to the bottom of the sea.</p>\\n\\n<p>4. An oxygen-deprived sea bottom and a fast deposit of sediments on the dead organisms.</p>\\n\\n<p>5. Since Hjoula is in Lebanon and was covered by the Thethys sea, lots of animals could have been fossilized during that period (as described in the answers to the previous questions).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f7956c56-3a73-4f34-93c0-daa63e0b8b72\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Elements of Answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Elements of Answers\"},\"subContentId\":\"82c5f1f1-7473-428c-ac86-b9fc0c3fbd14\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"subContentId\":\"9a242dc3-38a4-4981-8579-0c9728c85e91\",\"metadata\":{\"title\":\"Documentation tool\",\"license\":\"U\",\"contentType\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation tool\"}}},{\"content\":{\"params\":{\"contentName\":\"Image\",\"alt\":\"Graph of number of landslides compared to % area occupied by forests, as decreases\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABPEAAAGqCAYAAABqLNELAAAgAElEQVR4Xuzdh3Nc150n+u+9fTsh50gSDGAEc87BkihR2bIkW7ZlyzPrmdqq/Qfe+ytebb3a2nk7s7OetWXLylbOFMUcwBwRCBIgQOSMDje9+h0IHHpWJgESje7b/b0uFEl0973nfM4RfPG9J2iu67rgQQEKUIACFKAABShAAQpQgAIUoAAFKEABCqSsgMYQL2XbhgWjAAUoQAEKUIACFKAABShAAQpQgAIUoIASYIjHjkABClCAAhSgAAUoQAEKUIACFKAABShAgRQXYIiX4g3E4lGAAhSgAAUoQAEKUIACFKAABShAAQpQgCEe+wAFKEABClCAAhSgAAUoQAEKUIACFKAABVJcgCFeijcQi0cBClCAAhSgAAUoQAEKUIACFKAABShAAYZ47AMUoAAFKEABClCAAhSgAAUoQAEKUIACFEhxAYZ4Kd5ALB4FKEABClCAAhSgAAUoQAEKUIACFKAABRjisQ9QgAIUoAAFKEABClCAAhSgAAUoQAEKUCDFBRjipXgDsXgUoAAFKEABClCAAhSgAAUoQAEKUIACFGCIxz5AAQpQgAIUoAAFKEABClCAAhSgAAUoQIEUF2CIl+INxOJRgAIUoAAFKEABClCAAhSgAAUoQAEKUIAhHvsABShAAQpQgAIUoAAFKEABClCAAhSgAAVSXIAhXoo3E Doi8AAAAAAAAAAAAADIm+AAAAAAAAAAAAADAk+gIAAAAAAAAAAADAkOgLAAAAAAAAAAAAAEOiLwAAAAAAAAAAAAAMib4AAAAAAAAAAAAAMCT6AgAAAAAAAAAAAMCQ6AsAAAAAAAAAAAAAQ6IvAAAAAAAAAAAAAAyJvgAAAAAAAAAAAAAwJPoCAAAAAAAAAAAAwJDoCwAAAAAAAAAAAABDoi8AAAAAAAAAAAAADIm+AAAAAAAAAAAAADAk+gIAAAAAAAAAAADAkOgLAAAAAAAAAAAAAEOiLwAAAAAAAAAAAAAMib4AAAAAAAAAAAAAMCT6AgAAAAAAAAAAAMCQ6AsAAAAAAAAAAAAAQ6IvAAAAAAAAAAAAAAyJvgAAAAAAAAAAAAAwJPoCAAAAAAAAAAAAwJDoCwAAAAAAAAAAAABDoi8AAAAAAAAAAAAADIm+AAAAAAAAAAAAADAk+gIAAAAAAAAAAADAkOgLAAAAAAAAAAAAAEMBAAD//wMAIBFIt8XmQ9AAAAAASUVORK5CYII=\",\"mime\":\"image/png\",\"height\":1642,\"width\":2810}},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9c60ee5e-90f6-4115-8132-1a19668924c2\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p>Scientists were trying to determine if a relation exists between <strong>landslides</strong> and the <strong>% of area occupied by forest </strong>in the Cedars region of Lebanon. The results of the studies conducted are found in the graph above.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"77642222-d705-4af8-be58-bfb6186db643\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Landlides and Deforestation\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1. Give a title to the above graph. </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"55071737-eff6-4075-9264-3c819e7b43d8\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2.. What is the problem being addressed by the study? </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"b6b3366a-2be4-4e36-8f56-8138d4e9bf7e\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3. In which year was the <strong>number of landslides </strong>the highest? The lowest?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"50978ec0-4184-4409-83d7-7b56f1a3bf25\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. In which year was the <strong>% of area occupied by forest </strong>the highest? The lowest?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"b555dfb2-9daa-4463-ac1f-065acbc64c9e\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>5. Conclude by identifying the factor increasing landslides.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"3447565d-1df8-4552-9398-12d3d2dd237c\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>6. Propose a solution to limit the landslides.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"8bbb6e7c-a049-4833-ac3c-9ae4d451bfa1\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Landslides and Deforestation\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Landslides and Deforestation\"},\"subContentId\":\"140ede6f-8dae-4614-9494-c3c1297bdb53\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>After completely reading the document and answering the questions, check your answers below.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"ee587e30-4169-4371-acc7-7ac7c8a5e182\"},{\"params\":{\"text\":\"<p>1. Title: Variation of Landslide Frequency as a Function of Area Occupied by Forests.</p>\\n\\n<p>2. What is the impact of deforestation on landslides? </p>\\n\\n<p>or</p>\\n\\n<p>Is there a relation between landslides and the amount of area occupied by forests?</p>\\n\\n<p>3. Highest: 1920. Lowest: 1860-1880.</p>\\n\\n<p>4. Highest: 1860. Lowest: 1920.</p>\\n\\n<p>5. The % of area occupied by forest decreased to 15% in 1920, the number of landslides increased to 160. As the % increases after 1920, the number of landslides also decreases.</p>\\n\\n<p>Thus, the factor that favors landslides is less area occupied by forests / deforestation.</p>\\n\\n<p>6. Spreading awareness, reforestation (planting new trees), protecting and expanding nature reserves, conducting geotechnical studies to assess the risk of landslides, etc.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b8c042bc-91d3-4cca-ba91-a52f490e181b\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Elements of Answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Elements of Answers\"},\"subContentId\":\"dd9f1635-0e45-42f6-9cdb-ccc6bbd71f53\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Landlides and Deforestation\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Landlides and Deforestation\"},\"subContentId\":\"1278762c-2843-4fb1-ad9c-9fe67d11fca0\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.12","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"I Solve Complex Problems","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.TextInputField-1.2/text-input-field.js?version=1.2.13","/h5p/libraries/H5P.TextInputField-1.2/xapi-generator.js?version=1.2.13","/h5p/libraries/H5P.Text-1.1/scripts/text.js?version=1.1.17","/h5p/libraries/H5P.StandardPage-1.5/standard-page.js?version=1.5.15","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.DocumentationTool-1.8/navigation-menu.js?version=1.8.24","/h5p/libraries/H5P
